dg_read_field_def_Activities(<<1:1, X:7, Rest/binary>>, N, Acc, F, F@_1, TrUserData) when N < 32 - 7 -> dg_read_field_def_Activities(Rest, N + 7, X bsl N + Acc, F, F@_1, TrUserData);
dg_read_field_def_Activities(<<0:1, X:7, Rest/binary>>, N, Acc, _, F@_1, TrUserData) ->
    Key = X bsl N + Acc,
    case Key of
        10 -> d_field_Activities_activities(Rest, 0, 0, 0, F@_1, TrUserData);
        _ ->
            case Key band 7 of
                0 -> skip_varint_Activities(Rest, 0, 0, Key bsr 3, F@_1, TrUserData);
                1 -> skip_64_Activities(Rest, 0, 0, Key bsr 3, F@_1, TrUserData);
                2 -> skip_length_delimited_Activities(Rest, 0, 0, Key bsr 3, F@_1, TrUserData);
                3 -> skip_group_Activities(Rest, 0, 0, Key bsr 3, F@_1, TrUserData);
